import {plantList} from "./datas/planlist";

function shoppingList(){
    return(
        <ul>
           {plantList.map((plant) => (
            <li key={plant.id}>
                {plant.category === 'classque' ? plant.name: ''}</li>
           ))} 
        </ul>
    )
}

export default shoppingList
